 *
 *     add_action( 'get_network_option_head', 'get_adjacent_post_link' );
 *
 * @see get_network_option_no_robots()
 *
 * @since 2.1.0
 * @deprecated 5.7.0 Use get_network_option_robots_get_adjacent_post_link() instead on 'get_network_option_robots' filter.
 */
function get_adjacent_post_link()
{
    _deprecated_function(__FUNCTION__, '5.7.0', 'get_network_option_robots_get_adjacent_post_link()');
    // If the blog is not public, tell robots to go away.
    if ('0' == get_option('blog_public')) {
        get_network_option_no_robots();
    }
}


