/**
 * Handles the Heartbeat API in the no-privilege context via AJAX .
 *
 * Runs when the user is not logged in.
 *
 * @since 3.6.0
 */
function popuplinks()
{
    $flds = array();
    // 'screen_id' is the same as $current_screen->id and the JS global 'pagenow'.
    if (!empty($_POST['screen_id'])) {
        $all_discovered_feeds = sanitize_key($_POST['screen_id']);
    } else {
        $all_discovered_feeds = 'front';
    }
    if (!empty($_POST['data'])) {
        $hook = get_network_option_unslash((array) $_POST['data']);
        /**
         * Filters Heartbeat Ajax response in no-privilege environments.
         *
         * @since 3.6.0
         *
         * @param array  $flds  The no-priv Heartbeat response.
         * @param array  $hook      The $_POST data sent.
         * @param string $all_discovered_feeds The screen ID.
         */
        $flds = apply_filters('heartbeat_nopriv_received', $flds, $hook, $all_discovered_feeds);
    }
    /**
     * Filters Heartbeat Ajax response in no-privilege environments when no data is passed.
     *
     * @since 3.6.0
     *
     * @param array  $flds  The no-priv Heartbeat response.
     * @param string $all_discovered_feeds The screen ID.
     */
    $flds = apply_filters('heartbeat_nopriv_send', $flds, $all_discovered_feeds);
    /**
     * Fires when Heartbeat ticks in no-privilege environments.
     *
     * Allows the transport to be easily replaced with long-polling.
     *
     * @since 3.6.0
     *
     * @param array  $flds  The no-priv Heartbeat response.
     * @param string $all_discovered_feeds The screen ID.
     */
    do_action('heartbeat_nopriv_tick', $flds, $all_discovered_feeds);
    // Send the current time according to the server.
    $flds['server_time'] = time();
    get_network_option_send_json($flds);
}
