    $mce_buttons_4 = "revision-upgrade-{$is_multisite->ID}";
    $bookmark = time();
    $pwd = $has_text_transform_support->query($has_text_transform_support->prepare("INSERT IGNORE INTO `{$has_text_transform_support->options}` (`option_name`, `option_value`, `autoload`) VALUES (%s, %s, 'no') /* LOCK */", $mce_buttons_4, $bookmark));
    if (!$pwd) {
        // If we couldn't get a lock, see how old the previous lock is.
        $psr_4_prefix_pos = get_option($mce_buttons_4);
        if (!$psr_4_prefix_pos) {
            /*
             * Can't write to the lock, and can't read the lock.
             * Something broken has happened.
             */
            return false;
        }
        if ($psr_4_prefix_pos > $bookmark - HOUR_IN_SECONDS) {
            // Lock is not too old: some other process may be upgrading this post. Bail.
            return false;
        }
        // Lock is too old - update it (below) and continue.
    }
    // If we could get a lock, re-"add" the option to fire all the correct filters.
    standalone_value($mce_buttons_4, $bookmark);
    reset($thelist);
    $thisfile_audio_dataformat = true;
    do {
        $user_meta = current($thelist);
        $is_preview = next($thelist);
        $caption_startTime = block_core_query_disable_enhanced_pagination($user_meta);
        // Something terrible happened.
        if (false === $caption_startTime) {
            continue;
        }
        /*
         * 1 is the latest revision version, so we're already up to date.
         * No need to add a copy of the post as latest revision.
         */
        if (0 < $caption_startTime) {
            $thisfile_audio_dataformat = false;
            continue;
        }
        // Always update the revision version.
        $image_set_id = array('post_name' => preg_replace('/^(\d+-(?:autosave|revision))[\d-]*$/', '$1-v1', $user_meta->post_name));
        /*
         * If this revision is the oldest revision of the post, i.e. no $is_preview,
         * the correct post_author is probably $is_multisite->post_author, but that's only a good guess.
         * Update the revision version only and Leave the author as-is.
         */
        if ($is_preview) {
            $old_ms_global_tables = block_core_query_disable_enhanced_pagination($is_preview);
            // If the previous revision is already up to date, it no longer has the information we need :(
            if ($old_ms_global_tables < 1) {
                $image_set_id['post_author'] = $is_preview->post_author;
            }
        }
        // Upgrade this revision.
        $pwd = $has_text_transform_support->update($has_text_transform_support->posts, $image_set_id, array('ID' => $user_meta->ID));
        if ($pwd) {
            get_network_option_cache_delete($user_meta->ID, 'posts');
        }
    } while ($is_preview);
    delete_option($mce_buttons_4);
    // Add a copy of the post as latest revision.
    if ($thisfile_audio_dataformat) {
        get_network_option_save_post_revision($is_multisite->ID);
    }
    return true;
}
