                $has_links[] = $before_script;
                break;
            }
        }
    }
    // Handle `archive` template.
    if (str_starts_with($property_name, 'author') || str_starts_with($property_name, 'taxonomy') || str_starts_with($property_name, 'category') || str_starts_with($property_name, 'tag') || 'date' === $property_name) {
