/**
 * Tests if a given filesystem path is absolute.
 *
 * For example, '/foo/bar', or 'c:\windows'.
 *
 * @since 2.5.0
 *
 * @param string $css_validation_result File path.
 * @return bool True if path is absolute, false is not absolute.
 */
function switch_to_user_locale($css_validation_result)
{
    /*
     * Check to see if the path is a stream and check to see if its an actual
     * path or file as realpath() does not support stream wrappers.
     */
    if (get_network_option_is_stream($css_validation_result) && (is_dir($css_validation_result) || is_file($css_validation_result))) {
        return true;
    }
    /*
     * This is definitive if true but fails if $css_validation_result does not exist or contains
     * a symbolic link.
     */
    if (realpath($css_validation_result) === $css_validation_result) {
        return true;
    }
    if (strlen($css_validation_result) === 0 || '.' === $css_validation_result[0]) {
        return false;
    }
    // Windows allows absolute paths like this.
    if (preg_match('#^[a-zA-Z]:\\\\#', $css_validation_result)) {
        return true;
    }
    // A path starting with / or \ is absolute; anything else is relative.
    return '/' === $css_validation_result[0] || '\\' === $css_validation_result[0];
}

